import React from 'react';
import cities from 'api/cities.json';
function Form() {
    console.log(cities)
    return (
        <div>
            <select name="city">
                {
                    cities.map((city)=>
                    <option>city</option>)
                }
            </select>
        </div>
    );
}

export default Form;
